for x in data:
    color_attr,created=Attribute.objects.get_or_create(name="Color")
    sku=x.get('product_id')[:8]
    product,created=Product.objects.get_or_create(sku=sku)
    brand,created=Manufacturer.objects.get_or_create(name="Sequin Crafts")
    product.manufacturer=brand
    product.name=x.get('name')
    category,created=Category.objects.get_or_create(name="Kurtis")
    product.primary_category=category
    product.categories.add(category)
    product.status=1
    product.return_days=14
    tc,created=TaxClass.objects.get_or_create(name="Clothing")
    product.tax_class=tc
    product.primary_attribute=color_attr
    product.save()

    option_sku=''
    primary_color=''
    for attr in x.get('attrs'):
        if attr.get('name') == 'Style Code':
            option_sku=attr.get('value')
        if attr.get('name') == 'Brand Color':
            primary_color=attr.get('value')

    product_option,created=ProductOption.objects.get_or_create(product=product,sku=option_sku)
    product_option.rate=x.get('actual_mrp').replace(',','')
    product_option.discount_percentage=x.get('discount')
    product_option.save()


    for attr in x.get('attrs'):
        ProducOptionStatictAttributes.objects.get_or_create(product_option=product_option,name=attr.get('name'),value=attr.get('value'))


    size_attr,created=Attribute.objects.get_or_create(name="Size")
    for size in x.get('sizes'):
        value=size.get('name')
        poa,created=ProductOptionAttributes.objects.get_or_create(product_option=product_option,attribute=size_attr,value=value)    
        poa.label=size.get('desc')
        poa.save()


    poa,created=ProductOptionAttributes.objects.get_or_create(product_option=product_option,attribute=color_attr,value=primary_color,label=primary_color)    


    ProductOptionImage.objects.filter(product_option=product_option).delete()
    for image in x.get('images'):
        image=image.replace('background-image:url(','').replace(')','').replace('/128','/1900')
        
        # image_content = ContentFile(requests.get(url).content)
        r = requests.get(image,timeout=5)

        img_temp = NamedTemporaryFile(delete=True)
        img_temp.write(r.content)
        img_temp.flush()
        poi=ProductOptionImage.objects.create(product_option=product_option)
        poi.image.save("produt_{}.jpg".format(poi.id), File(img_temp), save=True)

